import React from "react";
import { Routes, Route } from "react-router-dom";
import Home from "./Home";
import InfosPratiques from "./InfosPratiques";
import { useLocation } from "react-router-dom";


export default function App() {
  return (
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/InfosPratiques" element={<InfosPratiques />} />
    </Routes>
  );
  
}
function SampleNextArrow({ onClick }) {
    return (
      <div
        className="absolute top-1/2 -right-6 transform -translate-y-1/2 cursor-pointer z-10"
        onClick={onClick}
      >
        <div className="text-3xl text-[#2389c6] hover:text-[#216a95]">›</div>
      </div>
    );
  }
  
  function SamplePrevArrow({ onClick }) {
    return (
      <div
        className="absolute top-1/2 -left-6 transform -translate-y-1/2 cursor-pointer z-10"
        onClick={onClick}
      >
        <div className="text-3xl text-[#2389c6] hover:text-[#216a95]">‹</div>
      </div>
    );
  }
